import React, { Component } from 'react';
import './Gallery.css';


class Gallery extends Component {
  render() {
    return (
      <div class="flex-container">
      <div>1</div>
      <div>2</div>
      <div>3</div>  
      <div>4</div>
      <div>5</div>
      <div>6</div>  
      <div>7</div>
      <div>8</div>
    </div>
    );
  }
}

export default Gallery;
